<template>
    <div class="flex flex-col items-center justify-center">
        <AlertCustome v-if="state.Error.auth.alert" :title="state.Error.auth.title"
            :description="state.Error.auth.message" :svg="state.Error.auth.svg" :open="isOpen"
            @update:open="isOpen = $event">
        </AlertCustome>
        <div class="flex items-center justify-center px-6 py-8 mx-auto lg:py-0">
            <div class="w-full bg-neutral-50 rounded-lg shadow border">
                <div class="p-6 space-y-4 md:space-y-6 sm:p-8">
                    <svg width="77" height="64" viewBox="0 0 77 64" fill="none" xmlns="http://www.w3.org/2000/svg"
                        class="mx-auto" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <rect width="77" height="64" fill="url(#pattern0_63_21)" />
                        <defs>
                            <pattern id="pattern0_63_21" patternContentUnits="objectBoundingBox" width="1" height="1">
                                <use xlink:href="#image0_63_21"
                                    transform="matrix(0.00452131 0 0 0.00542557 -1.08474 -0.494802)" />
                            </pattern>
                            <image id="image0_63_21" width="702" height="355"
                                xlink:href="data:image/png;base64," />
                        </defs>
                    </svg>
                    <p class="text-xl text-center font-bold leading-tight tracking-tight text-gray-900 md:text-2xl">
                        Админ
                    </p>
                    <form @submit.prevent="postUser">
                        <div v-for="(item, i) in text" :key="i">
                            <label class="block mb-2 text-sm font-medium text-gray-900">{{ item.title }}</label>
                            <input :autocomplete="i === 1 ? 'on' : undefined"
                                v-model="login[item.vmodel as keyof typeof login]"
                                class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg block w-full p-2.5"
                                :type="item.type" :name="item.title" />
                        </div>

                        <div>
                            <button type="submit"
                                class="rounded-sm mt-3 bg-neutral-200 p-2 hover:bg-neutral-400 hover:text-neutral-50 cursor-pointer">
                                Login
                            </button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    </div>
</template>

<script setup lang="ts">
import { ref, reactive, watch } from 'vue';
import { useStorage } from '~/state/index';
import AlertCustome from '~/components/ui/customAlert/alertCustome.vue';
import { useRouter } from 'vue-router';
import { useSupabaseUser } from '#imports';

const state = useStorage();
const user = useSupabaseUser();

const login = reactive({
    email: '' as string,
    password: '' as string
});


const text = [{ title: 'email', type: 'email', vmodel: 'email' }, { title: 'password', type: 'password', vmodel: 'password' }]
const isOpen = ref<boolean>(false);
const router = useRouter();

const postUser = async () => {
    if (login.email.trim() === '' || login.password.trim() === '') {
        console.log(login.email, login.password)
        state.RangeError('Login and password must not be empty.', 'Error');
    } else {
        await state.SignIn(login.email, login.password);
    }
};

watch(
    () => [state.Error.auth.title, user.value?.id], // Следим за изменениями этих значений
    ([authTitle, userId]) => {
        if (authTitle === 'Success' || userId) {
            isOpen.value = state.Error.auth.alert;
            router.push('/main');
        }
    },
    { immediate: true } // Немедленно выполняем callback один раз при монтировании
);


</script>